{
  "name": "UBX-CFG-MSG",
  "class_id": "0x06",
  "message_id": "0x01",
  "description": "Configuration message for polling or setting message rates for UBX protocol messages.",
  "variants": [
    {
      "name": "Poll a message configuration",
      "message_type": "polled",
      "payload_length": {
        "fixed": 2
      },
      "fields": [
        {
          "byte_offset": 0,
          "name": "msgClass",
          "data_type": "U1",
          "description": "Message class"
        },
        {
          "byte_offset": 1,
          "name": "msgID",
          "data_type": "U1",
          "description": "Message identifier"
        }
      ]
    },
    {
      "name": "Set message rate(s) (all ports)",
      "message_type": "get_set",
      "payload_length": {
        "fixed": 8
      },
      "fields": [
        {
          "byte_offset": 0,
          "name": "msgClass",
          "data_type": "U1",
          "description": "Message class"
        },
        {
          "byte_offset": 1,
          "name": "msgID",
          "data_type": "U1",
          "description": "Message identifier"
        },
        {
          "byte_offset": 2,
          "name": "rate",
          "data_type": {
            "array_of": "U1",
            "count": 6
          },
          "description": "Send rate on I/O port (6 ports)"
        }
      ]
    },
    {
      "name": "Set message rate (current port)",
      "message_type": "get_set",
      "payload_length": {
        "fixed": 3
      },
      "fields": [
        {
          "byte_offset": 0,
          "name": "msgClass",
          "data_type": "U1",
          "description": "Message class"
        },
        {
          "byte_offset": 1,
          "name": "msgID",
          "data_type": "U1",
          "description": "Message identifier"
        },
        {
          "byte_offset": 2,
          "name": "rate",
          "data_type": "U1",
          "description": "Send rate on current port"
        }
      ]
    }
  ]
}
